import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import { Navbar, Nav, Container } from 'react-bootstrap';

const NavbarComponent = () => {
  const location = useLocation();

  return (
    <Navbar 
      expand="lg" 
      fixed="top"
      style={{
        background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
        boxShadow: '0 2px 20px rgba(0,0,0,0.1)'
      }}
    >
      <Container>
        <Navbar.Brand as={Link} to="/" className="text-white d-flex align-items-center">
          <i className="bi bi-hospital fs-3 me-2"></i>
          <div>
            <span className="fw-bold fs-5">HealthAdmin Lite</span>
            <small className="d-block" style={{fontSize: '10px', opacity: 0.8}}>
              Sistema de Gestión Médica
            </small>
          </div>
        </Navbar.Brand>
        
        <Navbar.Toggle aria-controls="basic-navbar-nav">
          <span className="navbar-toggler-icon" style={{filter: 'invert(1)'}}></span>
        </Navbar.Toggle>
        
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <Nav.Link 
              as={Link} 
              to="/dashboard" 
              className={`text-white mx-2 ${location.pathname === '/dashboard' ? 'fw-bold' : ''}`}
            >
              <i className="bi bi-speedometer2 me-1"></i>
              Dashboard
            </Nav.Link>
            
            <Nav.Link 
              as={Link} 
              to="/pacientes" 
              className={`text-white mx-2 ${location.pathname.includes('/pacientes') ? 'fw-bold' : ''}`}
            >
              <i className="bi bi-people-fill me-1"></i>
              Pacientes
            </Nav.Link>
            
            <Nav.Link 
              as={Link} 
              to="/pacientes/nuevo" 
              className="text-white mx-2"
            >
              <button className="btn btn-sm btn-light rounded-pill px-3">
                <i className="bi bi-plus-circle me-1"></i>
                Nuevo Paciente
              </button>
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavbarComponent;
